import React from 'react';
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import Form from "react-bootstrap/Form";
import Container from "react-bootstrap/Container";


const MoreHideOptions = ({onClickShowMore, isShowMore}) => (
                       <Row>
                            <Col md={5}>
                                <small style={{color: 'white'}}>For 1-2 passengers with 1-2 bags</small>
                            </Col>    <Col md={{span: 3, offset: 3}} style={{color: 'red'}}
                                 className='d-flex justify-content-end'>
                                <div
                                    style={{cursor: 'pointer'}}
                                    onClick={onClickShowMore}
                                    aria-controls="example-collapse"

                                >
                                    {!isShowMore ? <small>more options</small> : <small>hide options</small>}
                                </div>
                            </Col>
                           </Row>

);
export default MoreHideOptions;
